import React from 'react';
import styled from 'styled-components';
import { Container, Col, Row } from 'react-grid-system';




interface Props { }

const Landing: React.FunctionComponent<Props> = () => {

  return (
    <>
      <Container>
        <MainWrapper>
          <div className="top">
            <a href="/"><img src="logo.svg" /></a>
            <Box className="box-top-right-border"></Box>
          </div>
          <div className="mid">
            <div className="main-text">
              <div>Puskal</div>
              <div>Design</div>
            </div>
          </div>
          <div className="bottom">
            <Box className="box-bottom-left-border"></Box>
            <div className="social">social</div>
          </div>
        </MainWrapper>
      </Container>
    </>
  );
};

const MainWrapper = styled.main`
// height:100vh;
display:flex;
flex-direction:column;
justify-content: space-between;
// padding:${({ theme }) => theme.spacing.xxxl} 0;
&>div{
  display:flex;
  justify-content:space-between;
  // flex: 1;
  height:33.33vh;
  max-height:33.33vh;
  min-height:33.33vh;
  &.top{
    // padding-top:${({ theme }) => theme.spacing.xxxl};
    background: lightblue;
  }
  &.bottom{
    // padding-bottom:${({ theme }) => theme.spacing.xxxl};
    background: lightgrey;
  }
  &.mid{
    background: lightcoral;
    justify-content: center;
    font-size:150px;
    font-weight:bold;
    text-transform: uppercase;
    .main-text {
      // position: absolute;
      // left: auto;
      // top: auto;
      // transform: translateY(-25%);
  }
    .main-text>div:last-child{
      position: relative;
      transform: translateY(-61%);
      background: ${({ theme }) => theme.colors.primary.light};
      line-height: 100px;
      letter-spacing: -1.7px;
    }
  }
}
`;
const Box = styled.div`
    width:150px;
    height:150px;
    border:1px solid rgba(4,17,26,.2);
    &.box-top-right-border{
      border-bottom:none;
      border-left:none;
    }
    &.box-bottom-left-border{
      border-top:none;
      border-right:none;
    }
`;


export default Landing;
